metadata:
  name: s3-fast-failure
  labels:
    nuclio.io/project-name: default
spec:
  description: 'This function will fail swiftly'
  triggers: {}
  env: []
  disable: false
  loggerSinks:
  - level: debug
  handler: main:Handler
  runtime: golang
  build:
    runtimeAttributes:
      repositories: []
    noCache: false
    offline: false
    codeEntryType: s3
    dependencies: []
    codeEntryAttributes:
      s3Bucket: sdfsd
      s3ItemKey: sdfsdff
      s3AccessKeyId: sdfdsf
      s3SecretAccessKey: sdfsd
      s3Region: sdfsdf
      s3SessionToken: sdfsdf
      workDir: dsfsd
    image: ""
    mode: alwaysBuild
